import css from "styled-jsx/css";

export default <style>{`
    body{
        margin:10px;
    }
    header{
        font-size:64pt;
        font-weight:bold;
        text-align:right;
        letter-spacing:-8px;
        color:#ddddff;
        margin:-32px 5px;
    }
    footer{
        color:#99c;
        font-size:12pt;
        text-align:right;
        border-bottom:1px solid #99c;
        margin:50px 0px 10px 0px;
        position:relative;
        bottom:10px;
        right:10px;
        left:10px;
    }
    h1{
        font-size:22pt;
        font-Weight:bold;
        text-aligin:left;
        letter-spacing:0px;
        color:#77a;
        margin:-50px 0px 50px 0px;
    }
    p{
        margin:0px;
        color:#669;
        font-size:16pt;
    }
    hr{
        margin:25px 0px;
    }
    tr{
        margin:0px;
    }
    th{
        font-size:14pt;
        font-weight:plain;
        text-align:left;
        padding:0px 20px;
        margin:0px;
        border-bottom:1px solid gray;
    }
    td{
        font-size:14pt;
        font-weight:plain;
        text-align:right;
        pading:0px 20px;
        margin:0px;
        border-bottom:1px solid gray;
    }

`}</style>;
